import React, { Component } from "react";
import "./Heading.css";
import { Fade, Bounce } from "react-awesome-reveal";

 
class Heading extends Component {
  render() {
    return (
      <Fade>
        <p>Hello I will just Fade</p>
        <Bounce>
          <p> I will Fade and Bounce</p>
        </Bounce>
      </Fade>
    );
  }
}
export default Heading;
